import React from 'react'
import {
    Navbar,
    MobileNav,
    Typography,
    Button,
    IconButton,
  } from "@material-tailwind/react";

export const Nav = () => {
  return (
    <Navbar class="bg-black">
  <div class="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto p-4">
    <a href="https://flowbite.com/" class="flex items-start">
        <img src="/src/assets/Football_Icon 1.png" class="h-8 justify-start mr-5" alt="Flowbite Logo" />
        <span class="self-center text-xl whitespace-nowrap dark:text-white">Fantasy Footbal</span>
    </a>
    </div>
  </Navbar>
  )
}
export default Nav;
